        public async void mainline()
        {            
            await Exit_Trakker();
            //Util.Trakker(++ctr, "mainline");

            _mainline:
                
            try
            {
                isReProcess = false;
                flag_normal_brief = "N";
                flag_normal_tech = "N";
                do
                {
                    await initialize_objects();

                    ws_brief = " BRIEF";
                    ws_normal = "NORMAL";
                    ws_tech = "TP";

                    //  perform aa0-initialization		thru aa0-99-exit.;
                    await aa0_initialization();
                    await aa0_99_exit();

                    end_job = "N";
                    //     perform ab0-processing		thru ab0-99-exit;
                    //  	until end-job = "Y".;

                    await ab0_processing();
                    await ab0_10_acpt_clm_id();                   
                    await ab0_99_exit();
                    if (isReProcess) goto _mainline;
                } while (!end_job.ToUpper().Equals("Y"));

                //  perform az0-end-of-job		thru az0-99-exit.;
                await az0_end_of_job();
                await az0_99_exit();

                //     chain "$obj/menu".;
                //     stop run.;
            }
            catch (Exception e)
            {
                if (!e.Message.Contains(endOfJob))
                {
                    err_msg_comment = " Runtime error : " + e.Message.ToString();
                    Display3("err-msg-line.");
                    Write_ErrorLog("D003", e.Message, e.StackTrace);
                }
            }
            finally
            {
                if (Util.Str(end_job).ToUpper() == "Y")
                {
                    if (ExitCobol != null)
                    {
                        ExitCobol();
                    }
                }                
            }
            if (isReProcess) goto _mainline;
        }

