            {
                // 		if flag-normal-brief-n then       
                if (Util.Str(flag_normal_brief).Equals(flag_normal_brief_n))
                {
                    flag_normal_brief = "B";
                }
                else
                {
                    flag_normal_brief = "N";
                }
