        private async Task ga0_verify_birth_date()
        {
            await Exit_Trakker();
            //Util.Trakker(++ctr, "ga0_verify_birth_date");

            //     display scr-acpt-birth-yy.;
            //     accept  scr-acpt-birth-yy.;
            Display3("scr-acpt-changes-to-pat.", "scr-acpt-birth-yy");
            await Prompt("ws_pat_birth_date_yy", "scr-acpt-changes-to-pat.", "scr-acpt-birth-yy");

            //     display scr-acpt-birth-mm.;
            //     accept  scr-acpt-birth-mm.;
            Display3("scr-acpt-changes-to-pat.", "scr-acpt-birth-mm");
            await Prompt("ws_pat_birth_date_mm", "scr-acpt-changes-to-pat.", "scr-acpt-birth-mm");

            //     display scr-acpt-birth-dd.;
            //     accept  scr-acpt-birth-dd.;
            Display3("scr-acpt-changes-to-pat.", "scr-acpt-birth-dd");
            await Prompt("ws_pat_birth_date_dd", "scr-acpt-changes-to-pat.", "scr-acpt-birth-dd");

            flag = "Y";

            // if ws-pat-birth-date-mm < 01  or ws-pat-birth-date-mm > 12 then          
            if (ws_pat_birth_date_mm < 01 || ws_pat_birth_date_mm > 12)
            {
                flag = "N";
            }
            //  else if   ws-pat-birth-date-dd < 01 or ws-pat-birth-date-dd > max-nbr-days (ws-pat-birth-date-mm)  then            
            else if (ws_pat_birth_date_dd < 01 || ws_pat_birth_date_dd > max_nbr_days[ws_pat_birth_date_mm])
            {
                flag = "N";
            }

            // if not-ok  then            
            if (flag.Equals(not_ok))
            {
                err_ind = 27;
                // 	perform za0-common-error	thru za0-99-exit;
                await za0_common_error();
                await za0_99_exit();
                // 	go to ga0-verify-birth-date.;
                await ga0_verify_birth_date();
                return;
            }

            // if ws-pat-birth-date > sys-date then       
            if (ws_pat_birth_date > Util.NumInt(sys_date_grp))
            {
                err_ind = 4;
                //  	perform za0-common-error	thru za0-99-exit;
                await za0_common_error();
                await za0_99_exit();
                //  	go to ga0-verify-birth-date.;
                await ga0_verify_birth_date();
                return;
            }
        }

