        private async Task<string> ga0_acpt_subscr_addr()
        {
            await Exit_Trakker();
            //Util.Trakker(++ctr, "ga0_acpt_subscr_addr");

            //     display scr-acpt-subscr-addr1.;
            //     accept  scr-acpt-subscr-addr1.;
            Display3("scr-acpt-changes-to-pat.", "scr-acpt-subscr-addr1");
            await Prompt("ws_subscr_addr1", "scr-acpt-changes-to-pat.", "scr-acpt-subscr-addr1");

            //     display scr-acpt-subscr-addr2.;
            //     accept  scr-acpt-subscr-addr2.;
            Display3("scr-acpt-changes-to-pat.", "scr-acpt-subscr-addr2");
            await Prompt("ws_subscr_addr2", "scr-acpt-changes-to-pat.", "scr-acpt-subscr-addr2");

            //     display scr-acpt-subscr-addr3.;
            //     accept  scr-acpt-subscr-addr3.;
            Display3("scr-acpt-changes-to-pat.", "scr-acpt-subscr-addr3");
            await Prompt("ws_subscr_addr3", "scr-acpt-changes-to-pat.", "scr-acpt-subscr-addr3");

            //     display scr-acpt-postal-code.;
            //     accept  scr-acpt-postal-code.;
            Display3("scr-acpt-changes-to-pat.", "scr-acpt-postal-code");
            await Prompt("ws_subscr_postal_cd", "scr-acpt-changes-to-pat.", "scr-acpt-postal-code");

            //  if ( ws-pat-mess-code not = ' '  and hold-mess-code       = ' ' ) or (ws-pat-mess-code not = hold-mess-code)   then      
            if (
                (!string.IsNullOrWhiteSpace(ws_pat_mess_code) && string.IsNullOrWhiteSpace(hold_mess_code)) || (ws_pat_mess_code != hold_mess_code)
                )
            {
                clmhdr_tape_submit_ind = "H";
                // 	perform ga1-check-for-confidentiality thru ga1-99-exit;
                await ga1_check_for_confidentiality();
                await ga1_99_exit();

                // 	display scr-acpt-confidential-flag.;
                Display3("scr-acpt-changes-to-clmhdr.", "scr-acpt-confidential-flag");

            }

            // if ws-pat-birth-date not = hold-pat-birth-date  then            
            hold_pat_birth_date_grp = Util.Str(hold_pat_birth_yy).PadLeft(4, '0') + Util.Str(hold_pat_birth_mm).PadLeft(2, '0') + Util.Str(hold_pat_birth_dd).PadLeft(2, '0');
            if (Util.Str(ws_pat_birth_date) != Util.Str(hold_pat_birth_date_grp))
            {
                elig_flag_birth_date = "Y";
                ws_pat_last_birth_date = Util.NumInt(hold_pat_birth_date_grp);
            }

            // if ws-pat-version-cd not = hold-version-cd then
            if (ws_pat_version_cd_grp != hold_version_cd)
            {
                elig_flag_version_cd = "Y";
                ws_pat_last_version_cd = hold_version_cd;
            }

            update_confirmation = "";

            //   perform zb0-accept-confirm-update 	thru zb0-99-exit.;
            await zb0_accept_confirm_update();
            await zb0_99_exit();


            // if update-rejected  then            
            if (update_confirmation.Equals(update_rejected))
            {
                // 	   go to ga0-99-exit;                
                return "ga0_99_exit";
            }
            // else if update-modify  then            
            else if (update_confirmation.Equals(update_modify))
            {
                // 	    go to ga0-update-pat.;                
                return "ga0_update_pat";
            }

            // if elig-flag-version-cd = "Y" or elig-flag-birth-date = "Y" then         
            if (elig_flag_version_cd.ToUpper().Equals("Y") || elig_flag_birth_date.ToUpper().Equals("Y"))
            {
                //         open output resubmit-file;                                        // todo:... Not sure why OPEN then close right away....???
                //         close       resubmit-file;
                //        perform yy0-process-pat-elig-change thru yy0-99-exit;
                await yy0_process_pat_elig_change();
                await yy0_99_exit();

                //    perform yy3-update-rejected-claim   thru    yy3-99-exit.;
                await yy3_update_rejected_claim();
                await yy3_99_exit();
            }

            // if ws-pat-mess-code not = ' ' and hold-mess-code       = ' ' then          
            if (!string.IsNullOrWhiteSpace(ws_pat_mess_code) && string.IsNullOrWhiteSpace(hold_mess_code))
            {
                //         perform ga2-create-rejected-claim thru ga2-99-exit.;
                await ga2_create_rejected_claim();
                await ga2_99_exit();
            }

            //    perform xe0-rewrite-clmhdr			thru xe0-99-exit.;
            await xe0_rewrite_clmhdr();
            await xe0_99_exit();


            // if ws-pat-read-ind = "IK" then            
            if (ws_pat_read_ind == "IK")
            {
                //        perform xe1-re-write-patient     	thru xe1-99-exit;
                await xe1_re_write_patient();
                await xe1_99_exit();

            }
            // else    if ws-pat-read-ind = "OD" then;            
            else if (ws_pat_read_ind.ToUpper() == "OD")
            {
                //           perform xe2-re-write-patient-od  	thru xe2-99-exit;
                await xe2_re_write_patient_od();
                await xe2_99_exit();
            }
            //  else if ws-pat-read-ind = "HC" then            
            else if (ws_pat_read_ind.ToUpper() == "HC")
            {
                //              perform xe3-re-write-patient-hc    thru xe3-99-exit;
                await xe3_re_write_patient_hc();
                await xe3_99_exit();
            }
            //  else  if ws-pat-read-ind = "AC" then       
            else if (ws_pat_read_ind.ToUpper() == "AC")
            {
                //         perform xe4-re-write-patient-acr   thru xe4-99-exit;
                await xe4_re_write_patient_acr();
                await xe4_99_exit();
            }
            else
            {
                //        perform xe5-re-write-patient-chrt  thru xe5-99-exit.;
                await xe5_re_write_patient_chrt();
                await xe5_99_exit();
            }

            //     display scr-dis-clmhdr-lit.;
            Display3("scr-dis-clmhdr-lit.");

            //     display scr-acpt-clmhdr-values.;
            Display3("scr-acpt-clmhdr-values.");

            return string.Empty;
        }

