        private async Task<string> ga2_create_rejected_claim()
        {
            await Exit_Trakker();
            //Util.Trakker(++ctr, "ga2_create_rejected_claim");

            hold_claim_nbr_grp = "0";
            hold_clinic_nbr_1_2 = 0;
            hold_doc_nbr = "";
            hold_batch_nbr = 0;
            hold_claim_no = 0;

            hold_clinic_nbr_1_2 = clmhdr_clinic_nbr_1_2;
            hold_doc_nbr = clmhdr_doc_nbr;
            hold_batch_nbr = clmhdr_batch_nbr_7_9;
            hold_claim_no = clmhdr_claim_nbr;
            hold_claim_nbr_grp = Util.Str(hold_clinic_nbr_1_2) + Util.Str(hold_doc_nbr) + Util.Str(hold_batch_nbr) + Util.Str(hold_claim_no);
            objRejected_claims_rec.CLAIM_NBR = hold_claim_nbr_grp;
            objRejected_claims_rec.CLMHDR_PAT_OHIP_ID_OR_CHART = Util.Str(objClaims_mstr_rec.CLMHDR_PAT_KEY_TYPE) + Util.Str(objClaims_mstr_rec.CLMHDR_PAT_KEY_DATA);  //objClaim_header_rec.Clmhdr_pat_ohip_id_or_chart;

            objRejected_claims_rec.DOC_NBR = clmhdr_doc_nbr;
            objRejected_claims_rec.MESS_CODE = ws_pat_mess_code;

            //move clmhdr-loc of claim-header - rec to rejected-loc of rejected-claims - rec.
            objRejected_claims_rec.CLMHDR_LOC = objClaims_mstr_rec.CLMHDR_LOC;
             
            objRejected_claims_rec.LOGICALLY_DELETED_FLAG = "";

            //  write rejected-claims-rec;
            // 	invalid key;
            //            warn_ind = 16;
            //            perform zd0-common-warning      thru zd0-99-exit.;
            //            go to ga2-99-exit.;

            try
            {
                objRejected_claims_rec.RecordState = State.Added;
                objRejected_claims_rec.Submit();
            }
            catch (Exception e)
            {
                warn_ind = 16;
                //  perform zd0-common-warning      thru zd0-99-exit.;
                await zd0_common_warning();
                await zd0_99_exit();
                //  go to ga2-99-exit.;                
                return "ga2_99_exit";
            }

            //     add 1				to ctr-write-rejected-claims.;
            ctr_write_rejected_claims++;

            return string.Empty;
