        private async Task<string> ha0_create_adj_rec()
        {
            await Exit_Trakker();
            //Util.Trakker(++ctr, "ha0_create_adj_rec");

            //objIconst_mstr_rec.iconst_clinic_nbr_1_2 = clmhdr_clinic_nbr_1_2;
            //   read iconst-mstr;
            //     	invalid key;
            //     err_ind = 42;
            // 		perform za0-common-error thru za0-99-exit;
            // 		go to ha0-99-exit.;

            objIconst_mstr_rec = new ICONST_MSTR_REC
            {
                WhereIconst_clinic_nbr_1_2 = clmhdr_clinic_nbr_1_2
            }.Collection().FirstOrDefault();

            if (objIconst_mstr_rec == null)
            {
                err_ind = 42;
                // perform za0-common-error thru za0-99-exit;
                await za0_common_error();
                await za0_99_exit();
                // 		go to ha0-99-exit.;                
                return "ha0_99_exit";
            }

            // if clmhdr-date-period-end = iconst-date-period-end  and clmhdr-cycle-nbr       = iconst-clinic-cycle-nbr then       
            clmhdr_date_period_end_grp = Util.Str(clmhdr_period_end_yy) + Util.Str(clmhdr_period_end_mm).PadLeft(2,'0') + Util.Str(clmhdr_period_end_dd).PadLeft(2,'0');
            if (Util.NumInt(this.clmhdr_date_period_end_grp) == Util.NumInt(Util.Str(objIconst_mstr_rec.ICONST_DATE_PERIOD_END_YY).PadLeft(4,'0') + Util.Str(objIconst_mstr_rec.ICONST_DATE_PERIOD_END_MM).PadLeft(2,'0') + Util.Str(objIconst_mstr_rec.ICONST_DATE_PERIOD_END_DD).PadLeft(2,'0'))
                && Util.NumInt(clmhdr_cycle_nbr) == Util.NumInt(objIconst_mstr_rec.ICONST_CLINIC_CYCLE_NBR)
                )
            {
                err_ind = 43;
                // 	perform za0-common-error thru	za0-99-exit;
                await za0_common_error();
                await za0_99_exit();
                //  	go to ha0-99-exit.;                
                return "ha0_99_exit";
            }

            //   perform ze0-accept-reference-field	thru ze0-99-exit.;
            await ze0_accept_reference_field();
            await ze0_99_exit();

            update_confirmation = "";
            //   perform zb0-accept-confirm-update   thru zb0-99-exit.;
            await zb0_accept_confirm_update();
            await zb0_99_exit();

            // if update-modify then            
            if (update_confirmation.Equals(update_modify))
            {
                // 	 go to ha0-create-adj-rec;                
                return "ha0_create_adj_rec";
            }
            // else if     update-rejected then            
            else if (update_confirmation.Equals(update_rejected))
            {
                warn_ind = 3;
                //  perform zd0-common-warning      thru zd0-99-exit;
                await zd0_common_warning();
                await zd0_99_exit();
                // 	    go to ha0-99-exit;               
                return "ha0_99_exit";
            }
            else
            {
                // 	next sentence.;
            }

            //     perform xe0-rewrite-clmhdr          thru xe0-99-exit.;
            await xe0_rewrite_clmhdr();
            await xe0_99_exit();

            //objAdj_claim_rec.adj_claim_rec = 0;
            objAdj_claim_rec = new ADJ_CLAIM_FILE();

            //objAdj_claim_rec.adj_pat_acronym = clmhdr_pat_acronym;
            clmhdr_pat_acronym_grp = clmhdr_pat_acronym6 + clmhdr_pat_acronym3;
            objAdj_claim_rec.ADJ_PAT_ACRONYM = clmhdr_pat_acronym_grp;
            objAdj_claim_rec.ADJ_BATCH_NBR = clmhdr_batch_nbr;
            objAdj_claim_rec.ADJ_CLAIM_NBR = clmhdr_claim_nbr;

            save_oma_cd_suff_grp = "";
            save_oma_cd = "";
            save_oma_suff = "";

            amt_largest_diff = 0;
            save_adj_serv_date = 0;

            //     perform ha1-detail-with-largest-diff thru ha1-99-exit;
            //         varying i;
            //            from 1;
            //              by 1;
            //           until i >   ss-clmdtl.;

            i = 1;
            do
            {
                await ha1_detail_with_largest_diff();
                await ha1_99_exit();
                i++;
            } while (i <= ss_clmdtl);

            save_oma_cd_suff_grp = Util.Str(save_oma_cd) + Util.Str(save_oma_suff);
            objAdj_claim_rec.ADJ_OMA_CD_SUFF = save_oma_cd_suff_grp;
            objAdj_claim_rec.ADJ_SERV_DATE = save_adj_serv_date;
            objAdj_claim_rec.ADJ_AGENT_CD = Util.NumInt(clmhdr_agent_cd);

            //  compute adj-amt-bal = hold-clmhdr-bal * -1.;
            objAdj_claim_rec.ADJ_AMT_BAL = hold_clmhdr_bal * -1;

            objAdj_claim_rec.ADJ_DIAG_CD = save_diag_cd;
            objAdj_claim_rec.ADJ_LINE_NO = save_line_no;

            //     write adj-claim-rec.;
            objAdj_claim_rec.RecordState = State.Added;
            objAdj_claim_rec.Submit();

            return string.Empty;
        }

