        private async Task ha1_detail_with_largest_diff()
        {
            await Exit_Trakker();
            //Util.Trakker(++ctr, "ha1_detail_with_largest_diff");

            // if hold-clm-amt-due(i) < 0 then            
            if (hold_clm_amt_due[i] < 0)
            {
                // 	   compute ws-bal-dtl	=   0 - hold-clm-amt-due(i)            
                ws_bal_dtl = 0 - hold_clm_amt_due[i];
            }
            else
            {
                ws_bal_dtl = hold_clm_amt_due[i];
            }

            // if ws-bal-dtl > amt-largest-diff then        
            if (ws_bal_dtl > amt_largest_diff)
            {
                amt_largest_diff = ws_bal_dtl;
                save_oma_cd = hold_oma_cd[i];
                save_oma_suff = hold_oma_suff[i];
                save_adj_serv_date = Util.NumInt(hold_clm_svc_date[i]);
            }
        }

