                    Display3("scr-dis-clmdtl-lit-t.");
                }
            }

            // if flag-agent-on and clmhdr-agent-cd not = sel-agent-code then            
            if (Util.Str(flag_agent_code).Equals(flag_agent_on) && Util.Str(clmhdr_agent_cd) != Util.Str(sel_agent_code))
            {
                //         add 1			to ctr-nbr-claims-displayed;
                ctr_nbr_claims_displayed++;
                flag = "N";
