                //         perform xl0-setup-claim-nbr-disp	thru xl0-99-exit;
                await xl0_setup_claim_nbr_disp();
                await xl0_99_exit();
                //         display scr-dis-claim-id;
                Display3("scr-dis-claim-id.");

                //      perform xd0-display-claim		thru xd0-99-exit;     //
                await xd0_display_claim();
                _xd0_10_read_up_to_max_dtls:
                await xd0_10_read_up_to_max_dtls();

                string retval = await xd0_15_accept_y_n();
                if (retval.ToLower().Equals("xd0_99_exit"))
