            {
                //         perform ga0-update-pat          thru ga0-99-exit;      //
                _ga0_update_pat:
                await ga0_update_pat();
                await ga0_verify_birth_date();
                await ga0_acpt_version_cd();
                await ga0_acpt_expiry_date();
                await ga0_acpt_mess_code();
