                {
                    goto _ga0_update_pat;
                }
                await ga0_99_exit();

                //         perform ja0-update-head         thru ja0-99-exit;
                _ja0_update_head:
                await ja0_update_head();
                await ja01_verify_hosp();
                await ja02_verify_admit_date();
                await ja03_verify_review();
                await ja04_verify_submit();
                await ja05_verify_doc_spec();
                await ja06_verify_doc_nbr();
                await ja07_verify_ref_doc();
                await ja08_acpt_conf_flag();
                retval = await ja09_acpt_payroll();
                if (retval.ToLower().Equals("ja0_update_head"))
                {
                    goto _ja0_update_head;
                }
                await ja0_99_exit();

                //         perform ja1-update-detail       thru ja1-99-exit;        //
                //              varying i;
                //              from    1;
                //              by      1;
                //              until i > ss-clmdtl;

                i = 1;
                do
