                    _ja1_update_detail:
                    await ja1_update_detail();
                    await ja12_verify_svc_date();
                    await ja19_finish_acpt_date();
                    await ja11_verify_diag_code();
                    retval = await ja22_end_diag();
                    if (retval.ToLower().Equals("ja1_update_detail"))
                    {
                        goto _ja1_update_detail;
                    }
                    await ja1_99_exit();
                    i++;
                } while (i <= ss_clmdtl);

                clmhdr_serv_date = Util.Str(save_serv_date);
                //         perform xg0-update-claim        thru xg0-99-exit.;     //
                await xg0_update_claim();
                retval = await xg0_update_claim_00();
                if (retval.ToLower().Equals("xg0_99_exit"))
                {
                    goto _xg0_99_exit;
                }
                await xg0_50_update_header();
