        private async Task ia2_update_all()
        {
            await Exit_Trakker();
            //Util.Trakker(++ctr, "ia2_update_all");

            //   perform xe0-rewrite-clmhdr		thru xe0-99-exit.;
            await xe0_rewrite_clmhdr();
            await xe0_99_exit();

            //     perform jc0-rewrite-detail     thru jc0-99-exit;
            //                     varying i;
            //                     from    1;
            //                     by      1;
            //                     until i > ss-clmdtl;

            i = 1;
            do
            {
                await jc0_rewrite_detail();
                await jc0_99_exit();
                i++;
            } while (i <= ss_clmdtl);

            //  if ws-pat-read-ind = "IK" then            
            if (Util.Str(ws_pat_read_ind).ToUpper() == "IK")
            {
                //        perform xe1-re-write-patient     	thru xe1-99-exit;
                await xe1_re_write_patient();
                await xe1_99_exit();
            }
            //  else if ws-pat-read-ind = "OD" then            
            else if (Util.Str(ws_pat_read_ind).ToUpper() == "OD")
            {
                //       perform xe2-re-write-patient-od  	thru xe2-99-exit;
                await xe2_re_write_patient_od();
                await xe2_99_exit();
            }
            //  else  if ws-pat-read-ind = "HC"  then            
            else if (Util.Str(ws_pat_read_ind).ToUpper() == "HC")
            {
                //       perform xe3-re-write-patient-hc    thru xe3-99-exit;
                await xe3_re_write_patient_hc();
                await xe3_99_exit();
            }
            //  else if ws-pat-read-ind = "AC" then            
            else if (Util.Str(ws_pat_read_ind).ToUpper() == "AC")
            {
                //        perform xe4-re-write-patient-acr   thru xe4-99-exit;
                await xe4_re_write_patient_acr();
                await xe4_99_exit();
            }
            else
            {
                //      perform xe5-re-write-patient-chrt  thru xe5-99-exit.;
                await xe5_re_write_patient_chrt();
                await xe5_99_exit();
            }

            //  perform xg2-desc-dtl-update 	thru xg2-99-exit;
            //     	varying ss-desc from 1 by 1;
            //    	until ss-desc > 5.;

            ss_desc = 1;
            do
            {
                if (F002_CLAIMS_MSTR_DTL_DESC_Collection.Count() > 0 && ss_desc <= F002_CLAIMS_MSTR_DTL_DESC_Collection.Count())
                {
                    objF002_CLAIMS_MSTR_DTL_DESC = F002_CLAIMS_MSTR_DTL_DESC_Collection[ss_desc - 1];
                }
                await xg2_desc_dtl_update();
                await xg2_99_exit();
                ss_desc++;
            } while (ss_desc <= 5);
        }

