        private async Task<string> ja02_verify_admit_date()
        {
            await Exit_Trakker();
            //Util.Trakker(++ctr, "ja02_verify_admit_date");

            //     display scr-acpt-admit-yy.;
            //     accept  scr-acpt-admit-yy.;
            Display3("scr-acpt-changes-to-clmhdr.", "scr-acpt-admit-yy");
            await Prompt("clmhdr_date_admit_yy");

            // if clmhdr-date-admit-yy = zeros then
            if (clmhdr_date_admit_yy == 0)
            {
                //     clmhdr_date_admit_mm = "00";
                clmhdr_date_admit_mm = 0;
                //     clmhdr_date_admit_dd = "00";
                clmhdr_date_admit_dd = 0;
                //         display scr-acpt-admit-yy;
                Display3("scr-acpt-changes-to-clmhdr.", "scr-acpt-admit-yy");
                //         display scr-acpt-admit-mm;
                Display3("scr-acpt-changes-to-clmhdr.", "scr-acpt-admit-mm");
                //         display scr-acpt-admit-dd;
                Display3("scr-acpt-changes-to-clmhdr.", "scr-acpt-admit-dd");
                //         go to ja03-verify-review.;                
                return "ja03_verify_review";
            }

            // if  clmhdr-date-admit-yy > sys-yy then       
            if (clmhdr_date_admit_yy > sys_yy)
            {
                err_ind = 31;
                // 	   perform za0-common-error	thru za0-99-exit;
                await za0_common_error();
                await za0_99_exit();
                // 	    go to ja02-verify-admit-date.;                
                await ja02_verify_admit_date();
                return "";
            }

            //     display scr-acpt-admit-mm.;
            //     accept  scr-acpt-admit-mm.;
            Display3("scr-acpt-changes-to-clmhdr.", "scr-acpt-admit-mm");
            await Prompt("clmhdr_date_admit_mm");

            //     display scr-acpt-admit-dd.;
            //     accept  scr-acpt-admit-dd.;
            Display3("scr-acpt-changes-to-clmhdr.", "scr-acpt-admit-dd");
            await Prompt("clmhdr_date_admit_dd");

            flag = "Y";

            //  if clmhdr-date-admit-mm < 01 or clmhdr-date-admit-mm > 12 then      
            if (clmhdr_date_admit_mm < 01 || clmhdr_date_admit_mm > 12)
            {
                flag = "N";
            }
            //  else if   clmhdr-date-admit-dd < 01 or clmhdr-date-admit-dd > max-nbr-days (clmhdr-date-admit-mm) then            
            else if (clmhdr_date_admit_dd < 01 || clmhdr_date_admit_dd > max_nbr_days[clmhdr_date_admit_mm])
            {
                flag = "N";
            }

            //  if not-ok then            
            if (flag.Equals(not_ok))
            {
                err_ind = 27;
                // 	   perform za0-common-error	thru za0-99-exit;
                await za0_common_error();
                await za0_99_exit();
                // 	   go to ja02-verify-admit-date.;                
                await ja02_verify_admit_date();
                return string.Empty;
            }

            //  if clmhdr-date-admit > sys-date then    
            if (clmhdr_date_admit > Util.NumInt(sys_date_grp))
            {
                err_ind = 32;
                //  perform za0-common-error	thru za0-99-exit;
                await za0_common_error();
                await za0_99_exit();
                // 	    go to ja02-verify-admit-date.;                
                await ja02_verify_admit_date();
                return string.Empty; ;
            }

            flag = "Y";

            //     perform ja3-check-admit-vs-svc-date	thru ja3-99-exit;
            // 		varying ss;
            // 		from     1;
            // 		by       1;
            // 		until   ss > ss-clmdtl.;

            ss = 1;
            do
            {
                await ja3_check_admit_vs_svc_date();
                await ja3_99_exit();
                ss++;
            } while (ss <= ss_clmdtl);

            //  if not-ok then            
            if (flag.Equals(not_ok))
            {
                err_ind = 47;
                //  perform za0-common-error	thru za0-99-exit;
                await za0_common_error();
                await za0_99_exit();
                // 	   go to ja02-verify-admit-date.;                
                await ja02_verify_admit_date();
            }

            return string.Empty;
        }

