        private async Task<string> ja12_verify_svc_date()
        {
            await Exit_Trakker();
            //Util.Trakker(++ctr, "ja12_verify_svc_date");

            int mm = hold_clm_svc_date_mm[i];
            int dd = hold_clm_svc_date_dd[i];

            if (await IsDisplay_scr_dis_clmdet_adj_dot(pline1,i))  // added    
            {
                await display_hold_clmadj_svc_date(pline1, i, false);                
                hold_clm_svc_date_mm[i] = Util.NumInt(Util.Str(hold_clmadj_svc_date[i]).PadRight(10).Substring(4, 2));
                hold_clm_svc_date_dd[i] = Util.NumInt(Util.Str(hold_clmadj_svc_date[i]).PadRight(10).Substring(6, 2));
                await display_scr_dis_clmdet_slash(pline1, i);
                await display_scr_acpt_svc_date_mm_Hold_clm_svc_date_mm(pline1, i);
                await display_scr_dis_clmdet_slash_2(pline1, i);
                await display_scr_acpt_svc_date_dd_Hold_clm_svc_date_dd(pline1, i);
            }            

            //     display scr-acpt-svc-date-yy.;
            //     accept  scr-acpt-svc-date-yy.;                       
            await display_scr_acpt_svc_date_yy_Hold_clm_svc_date_yy(pline1,i);
            await accept_scr_acpt_svc_date_yy_Hold_clm_svc_date_yy(pline1,i);

            // if  hold-clm-svc-date-yy (i) > sys-yy then    
            if (hold_clm_svc_date_yy[i] > sys_yy)
            {
                err_ind = 31;
                //   perform za0-common-error	thru za0-99-exit;
                await za0_common_error();
                await za0_99_exit();
                // 	   go to ja12-verify-svc-date.;                
                await ja12_verify_svc_date();
                return string.Empty;
            }

            //     display scr-acpt-svc-date-mm.;
            //     accept  scr-acpt-svc-date-mm.;                   
            hold_clm_svc_date_mm[i] = mm;
            await display_scr_acpt_svc_date_mm_Hold_clm_svc_date_mm(pline1,i);
            await accept_scr_acpt_svc_date_mm_Hold_clm_svc_date_mm(pline1,i);


            //     display scr-acpt-svc-date-dd.;
            //     accept  scr-acpt-svc-date-dd.;           
            //await Prompt("hold_clm_svc_date_dd[" + i + "]");

            hold_clm_svc_date_dd[i] = dd;
            await display_scr_acpt_svc_date_dd_Hold_clm_svc_date_dd(pline1,i);
            await accept_scr_acpt_svc_date_dd_Hold_clm_svc_date_dd(pline1,i);

            hold_clm_svc_date[i] = Util.Str(hold_clm_svc_date_yy[i], 4) + Util.Str(hold_clm_svc_date_mm[i], 2) + Util.Str(hold_clm_svc_date_dd[i], 2);
             
            flag = "Y";

            // if  hold-clm-svc-date-mm (i) < '01'  or hold-clm-svc-date-mm (i) > '12' then       
            if (hold_clm_svc_date_mm[i] < 1 || hold_clm_svc_date_mm[i] > 12)
            {
                flag = "N";
            }
            else
            {
                temp = hold_clm_svc_date_mm[i];
                // 	 if   hold-clm-svc-date-dd (i) < '01' or hold-clm-svc-date-dd (i)> max-nbr-days ( temp ) then     
                if (hold_clm_svc_date_dd[i] < 1 || hold_clm_svc_date_dd[i] > max_nbr_days[temp])
                {
                    flag = "N";
                }
            }

            // if not-ok  then       
            if (flag.Equals(not_ok))
            {
                err_ind = 27;
                // 	 perform za0-common-error	thru za0-99-exit;
                await za0_common_error();
                await za0_99_exit();
                // 	 go to ja12-verify-svc-date.;      
                await ja12_verify_svc_date();
                return string.Empty;
            }

            //  if hold-clm-svc-date (i) > sys-date then            
            if (Util.NumInt(hold_clm_svc_date[i]) > Util.NumInt(sys_date_grp))
            {
                err_ind = 27;
                //  perform za0-common-error	thru za0-99-exit;
                await za0_common_error();
                await za0_99_exit();
                // 	 go to ja12-verify-svc-date.;                
                await ja12_verify_svc_date();
                return string.Empty;
            }
        
            //  if i = 1 then            
            if (i == 1)
            {
                save_serv_date = Util.NumInt(hold_clm_svc_date[i]);
            }

            // if hold-clm-svc-date (i) < save-serv-date then      
            if (Util.NumInt(hold_clm_svc_date[i]) < save_serv_date)
            {
                save_serv_date = Util.NumInt(hold_clm_svc_date[i]);
            }
            return string.Empty;
        }

