        private async Task<string> xd0_display_claim()
        {
            await Exit_Trakker();
            //Util.Trakker(++ctr, "xd0_display_claim");

            //   add 1				to ctr-nbr-claims-displayed.;
            ctr_nbr_claims_displayed++;

            //   objIconst_mstr_rec.iconst_clinic_nbr_1_2 = clmhdr_clinic_nbr_1_2;
            //     read iconst-mstr;
            //         invalid key;
            //                 err_ind = 42;
            //                 perform za0-common-error thru za0-99-exit.;

            objIconst_mstr_rec = new ICONST_MSTR_REC
            {
                WhereIconst_clinic_nbr_1_2 = clmhdr_clinic_nbr_1_2
            }.Collection().FirstOrDefault();

            if (objIconst_mstr_rec == null)
            {
                err_ind = 42;
                //   perform za0-common-error thru za0-99-exit.;
                await za0_common_error();
                await za0_99_exit();
                return string.Empty;
            }

            //     perform xb0-verify-location         thru xb0-99-exit.;
            await xb0_verify_location();
            await xb0_99_exit();

            //  if   ws-pat-ohip-mmyy-r not = spaces then            
            if (!string.IsNullOrWhiteSpace(ws_pat_ohip_mmyy_r))
            {
                ws_pat_key_data = ws_pat_ohip_mmyy_grp;
            }
            else
            {
                ws_pat_key_data = ws_pat_chart_nbr_grp;
            }

            //     display scr-dis-clmhdr-lit.;
            Display3("scr-dis-clmhdr-lit.");
            //     display scr-acpt-clmhdr-values.;
            Display3("scr-acpt-clmhdr-values.");

            //   if clmhdr-batch-type = 'P' and clmhdr-adj-cd = 'M' then    
            if (Util.Str(clmhdr_batch_type).ToUpper() == "P" && Util.Str(clmhdr_adj_cd).ToUpper() == "M")
            {
                //     	if clmhdr-adj-cd-sub-type-ss = 0 then            
                if (clmhdr_adj_cd_sub_type_ss == 0)
                {
                    // 	        perform xd10-get-doc-perc thru xd10-99-exit;
                    await xd10_get_doc_perc();
                    await xd10_99_exit();
                }
                else
                {
                    // 	   perform xd11-get-const-perc thru xd11-99-exit.
                    await xd11_get_const_perc();
                    await xd11_99_exit();
                }
            }

            ws_agent_flag = clmhdr_agent_cd;

            //  if direct-bill-agent then;            
            if (ws_agent_flag.Equals(direct_bill_agent))
            {
                // 	    display scr-acpt-direct-bill-agent;
                Display3("scr-acpt-direct-bill-agent.");
            }
            else
            {
                //   	display scr-acpt-other.;
                //Display("scr-acpt-other.");
            }

            //     perform xm0-calc-claim-bal		thru xm0-99-exit.;
            await xm0_calc_claim_bal();
            await xm0_99_exit();

            //     perform xd7-clear-hold-clm-tbl	thru xd7-99-exit;
            // 			varying	subs;
            // 			from	1;
            // 			by	1;
            // 			until	subs > ws-max-nbr-dtls-on-scr + 1.;

            subs = 1;
            do
            {
                await xd7_clear_hold_clm_tbl();
                await xd7_99_exit();
                subs++;
            } while (subs <= ws_max_nbr_dtls_on_scr + 1);

            //     display scr-dis-blank-line-12-19.;
            Display3("scr-dis-blank-line-12-19.");

            //  perform xd8-clear-desc-tables 	thru xd8-99-exit;
            // 	    varying ss-desc from 1 by 1;
            // 	    until ss-desc = 6.;

            ss_desc = 1;
            do
            {
                await xd8_clear_desc_tables();
                await xd8_99_exit();
                ss_desc++;
            } while (ss_desc < 6);


            ss_clmdtl = 0;
            ss_desc = 0;
            ss_clmdtl_oma = 0;

            //     perform xd1-read-nxt-dtl-record	thru xd1-99-exit.;
            await xd1_read_nxt_dtl_record();
            await xd1_99_exit();

            //   if ok then            
            if (flag.Equals(ok))
            {
                ss_clmdtl = 1;
                //  perform xd3-display-first-dtl	thru xd3-99-exit;
                await xd3_display_first_dtl();
                await xd3_99_exit();
            }
            else
            {
                err_ind = 10;
                //  perform za0-common-error	thru za0-99-exit;
                await za0_common_error();
                await za0_99_exit();
                // 	    go to az0-end-of-job.;   
                isReProcess = true;             
                await az0_end_of_job();
            }
            return string.Empty;
        }

        private async Task xd0_10_read_up_to_max_dtls()
        {
            await Exit_Trakker();
            //Util.Trakker(++ctr, "xd0_10_read_up_to_max_dtls");

            flag = "Y";

            //     perform xd1-read-nxt-dtl-record 	thru xd1-99-exit;
