        private async Task<string> xd0_20_check_dtl()
        {
            await Exit_Trakker();
            //Util.Trakker(++ctr, "xd0_20_check_dtl");

            //  if ss-clmdtl > ws-max-nbr-dtls-on-scr then       
            if (ss_clmdtl > ws_max_nbr_dtls_on_scr)
            {
                flag_ref_fld = "*";
                Display3("scr-acpt-update.",false);
                // 	  display scr-acpt-roll-update;
                Display3("scr-acpt-roll-update.");
                // 	  accept scr-acpt-ref-fld;
                await Prompt("flag_ref_fld", "scr-acpt-roll-update.", "scr-acpt-ref-fld");
                //         if  flag-update-done or flag-update-done-alternative then     
                if (flag_ref_fld.Equals(flag_update_done) || flag_ref_fld.Equals(flag_update_done_alternative))
                {
                    // 	           display scr-dis-blank-line-12-19;
                    Display3("scr-dis-blank-line-12-19.");
                    // 	           perform xd7-clear-hold-clm-tbl;
                    // 					thru xd7-99-exit;
                    // 			        varying	subs;
                    // 			        from	1;
                    // 			        by	1;
                    // 			        until	subs > ws-max-nbr-dtls-on-scr;

                    subs = 1;
                    do
                    {
                        await xd7_clear_hold_clm_tbl();
                        await xd7_99_exit();
                        subs++;
                    } while (subs <= ws_max_nbr_dtls_on_scr);

                    // 	  perform xd9-move-last-element-to-first thru xd9-99-exit    
                    await xd9_move_last_element_to_first();
                    await xd9_99_exit();

                    // 	                add 1	, ws-max-nbr-dtls-on-scr;
                    // 					   giving subs;
                    subs = ws_max_nbr_dtls_on_scr + 1;
                    // 	                perform xd7-clear-hold-clm-tbl thru xd7-99-exit            
                    await xd7_clear_hold_clm_tbl();
                    await xd7_99_exit();
                    // 	                perform xd3-display-first-dtl thru xd3-99-exit            
                    await xd3_display_first_dtl();
                    await xd3_99_exit();

                    ss_clmdtl = 1;
                    //  go to xd0-10-read-up-to-max-dtls;                    
                    return "xd0_10_read_up_to_max_dtls";
                }
                else
                {
                    // 	          next sentence;
                }
            }
            else
            {
                // 	  display scr-clr-clm-roll;
                Display3("scr-clr-clm-roll.");
                flag_ref_fld = "*";
                // 	perform zc0-obtain-valid-selection thru zc0-99-exit.;
                await zc0_obtain_valid_selection();
                await zc0_99_exit();
            }


            //     if   flag-update-trailer-info;
            if (flag_ref_fld.Equals(flag_update_trailer_info)
                 //       or flag-update-done;
                 || flag_ref_fld.Equals(flag_update_done)
                 //       or flag-update-done-alternative;
                 || flag_ref_fld.Equals(flag_update_done_alternative)
                 //       or flag-update-reference-field;
                 || flag_ref_fld.Equals(flag_update_reference_field)
                  //       or flag-update-header-rec;
                  || flag_ref_fld.Equals(flag_update_header_rec)
                  //       or flag-update-details;
                  || flag_ref_fld.Equals(flag_update_details)
                  //       or flag-update-total-claim;
                  || flag_ref_fld.Equals(flag_update_total_claim)
