        {
            await Exit_Trakker();
            //Util.Trakker(++ctr, "xf6_access_f010_crm_ins");

            //  move spaces                                 to f010-crm - key.
            key_pat_mstr_grp = string.Empty;


            //  move clmhdr-pat-ohip-id-or-chart of claim-header-rec to key-pat-mstr of f010-crm-rec.
            key_pat_mstr_grp = Util.Str(objClaims_mstr_rec.CLMHDR_PAT_KEY_TYPE) + Util.Str(objClaims_mstr_rec.CLMHDR_PAT_KEY_DATA);

            /*05  f010 - crm - key.
                10  key - pat - mstr                pic x(16).
                10  crm - clmhdr - batch - nbr        pic x(8).
                10  crm - clmhdr - claim - nbr        pic 9(2).
                10  ghost - date - descending       pic 9(6).
                10  date - assigned               pic 9(8).
                10  time - assigned               pic 9(6).
                10  seq - nbr                     pic 9(2). */

            /* 05  clmhdr - pat - ohip - id - or - chart.
                 10  clmhdr - pat - key - type                 pic a.
                 10  clmhdr - pat - key - data.
                     15  clmhdr - pat - key - ohip             pic x(8).
                           15  filler                          pic x(7). */


            //  start f010 - crm key is greater than or equal to f010 - crm - key
            //        invalid key
            //        go to xf6 - 20.

            // read f010 - crm next into f010 - crm - rec
            //       at end
            //   go to xf6 - 20.

            bool isRetreiveRecord = false;

            F010_CRM_Collection = new F010_CRM
            {
                WhereKey_pat_mstr = key_pat_mstr_grp     //Todo: where...????
            }.Collection();

            if (F010_CRM_Collection.Count() == 0)
            {
                //   go to xf6 - 20.                
                return "xf6_20";
            }

            if (isRetreiveRecord)
            {
                // todo: not record counter is specified..
            }

            objF010_CRM = F010_CRM_Collection[0];

            //if key - pat - mstr of f010-crm - rec = clmhdr - pat - ohip - id - or - chart of claim-heade then       
            clmhdr_pat_key_data_grp = clmhdr_pat_key_ohip + new string(' ', 7);
            clmhdr_pat_ohip_id_or_chart_grp = clmhdr_pat_key_type + clmhdr_pat_key_data_grp;

            if (objF010_CRM.KEY_PAT_MSTR == clmhdr_pat_ohip_id_or_chart_grp)
            {
                //       if crm - clmhdr - batch - nbr = ' ' then            
                if (string.IsNullOrWhiteSpace(objF010_CRM.CLMHDR_BATCH_NBR))
                {
                    //           move 'PN'                           to flag-pn
                    flag_pn = "PN";
                }
                //       else if     crm - clmhdr - batch - nbr = clmhdr - batch - nbr   and crm-clmhdr - claim - nbr = clmhdr - claim - nbr  then            
                else if (objF010_CRM.CLMHDR_BATCH_NBR == clmhdr_batch_nbr && objF010_CRM.CLMHDR_CLAIM_NBR == clmhdr_claim_nbr)
                {
                    //           move 'CN'                       to flag-cn.
                    flag_cn = "CN";
                }
            }
            return string.Empty;
        }

