            key_pat_mstr_grp = Util.Str(objClaims_mstr_rec.CLMHDR_PAT_KEY_TYPE) + Util.Str(objClaims_mstr_rec.CLMHDR_PAT_KEY_DATA);


            //  move clmhdr - batch - nbr                       to ins-clmhdr - batch - nbr.
            //  move clmhdr - claim - nbr                       to ins-clmhdr - claim - nbr.

            //   start f010 - ins key is greater than or equal to f010 - ins - key
            //       invalid key
            //       go to xf6 - 99 - exit.

            //  read f010 - ins next into f010 - ins - rec
            //     at end
            //     go to xf6 - 99 - exit.

            bool isRetreiveRecord = false;

            F010_INS_Collection = new F010_INS
            {
                WhereKey_pat_mstr = key_pat_mstr_grp, // todo check this....????
                WhereClmhdr_batch_nbr = clmhdr_batch_nbr,
                WhereClmhdr_claim_nbr = clmhdr_claim_nbr
            }.Collection_UsingStart(ref isRetreiveRecord, F010_INS_Collection);

            if (F010_INS_Collection.Count() == 0)
            {
                //     go to xf6 - 99 - exit.                
                return "xf6_99_exit";
            }

            if (isRetreiveRecord)
            {
                // todo: not record counter is specified..
            }

            objF010_INS = F010_INS_Collection[0];

            //  if  key-pat-mstr of f010-ins-rec = clmhdr-pat-ohip-id-or-chart  of cla
            //      and ins-clmhdr - batch - nbr = clmhdr - batch - nbr
            //     and ins-clmhdr - claim - nbr = clmhdr - claim - nbr
            //     then
            clmhdr_pat_key_data_grp = clmhdr_pat_key_ohip + new string(' ', 7);
            clmhdr_pat_ohip_id_or_chart_grp = clmhdr_pat_key_type + clmhdr_pat_key_data_grp;
            if (objF010_INS.KEY_PAT_MSTR == clmhdr_pat_ohip_id_or_chart_grp && objF010_INS.CLMHDR_BATCH_NBR == clmhdr_batch_nbr && objF010_INS.CLMHDR_CLAIM_NBR == clmhdr_claim_nbr)
            {
                //        move 'CI'                       to flag-ci.
                flag_ci = "CI";
            }
            return string.Empty;
        }

