        private async Task<string> xg0_update_claim_00()
        {
            await Exit_Trakker();
            //Util.Trakker(++ctr, "xg0_update_claim_00");

            // if flag-update-reference-field then            
            if (flag_ref_fld.Equals(flag_update_reference_field))
            {
                //         perform ze0-accept-reference-field      thru ze0-99-exit;
                await ze0_accept_reference_field();
                await ze0_99_exit();
            }
            else
            {
                ws_agent_flag = Util.Str(hold_clmhdr_agent_cd);
                //       if direct-bill-agent then            
                if (ws_agent_flag.Equals(direct_bill_agent))
                {
                    // 	         perform xg1-direct-bill-acpt	thru xg1-99-exit;    //
                    await xg1_direct_bill_acpt();
                    await xg1_acpt_sub_msg_cont();
                    await xg1_acpt_sub_eff_date();
                    await xg1_acpt_msg_cont();
                    await xg1_acpt_reprint();
                    await xg1_acpt_sub();
                    await xg1_acpt_sub_cont();
                    await xg1_acpt_auto_logout();
                    await xg1_acpt_fee();
                    _xg1_acpt_desc_1:
                    await xg1_acpt_desc_1();
                    _xg1_acpt_desc_2:
                    string retval = await xg1_acpt_desc_2();
                    if (retval.ToLower().Equals("xg1_acpt_desc_1"))
                    {
                        goto _xg1_acpt_desc_1;
                    }
                    _xg1_acpt_desc_3:
                    retval = await xg1_acpt_desc_3();
                    if (retval.ToLower().Equals("xg1_acpt_desc_2"))
                    {
                        goto _xg1_acpt_desc_2;
                    }
                    _xg1_acpt_desc_4:
                    retval = await xg1_acpt_desc_4();
                    if (retval.ToLower().Equals("xg1_acpt_desc_3"))
                    {
                        goto _xg1_acpt_desc_3;
                    }
                    retval = await xg1_acpt_desc_5();
                    if (retval.ToLower().Equals("xg1_acpt_desc_4"))
                    {
                        goto _xg1_acpt_desc_4;
                    }
                    await xg1_99_exit();

                    // 	         perform xg4-accept-verify-ref-date	thru xg4-99-exit;
                    await xg4_accept_verify_ref_date();
                    await xg4_99_exit();

                    // 	         perform xg5-accept-ref-inits	thru xg5-99-exit;
                    await xg5_accept_ref_inits();
                    await xg5_99_exit();
                }
                else
                {
                    // 	         perform xg1-acpt-desc-1		thru xg1-99-exit;
                    _xg1_acpt_desc_1:
                    await xg1_acpt_desc_1();
                    _xg1_acpt_desc_2:
                    string retval = await xg1_acpt_desc_2();
                    if (retval.ToLower().Equals("xg1_acpt_desc_1"))
                    {
                        goto _xg1_acpt_desc_1;
                    }
                    _xg1_acpt_desc_3:
                    retval = await xg1_acpt_desc_3();
                    if (retval.ToLower().Equals("xg1_acpt_desc_2"))
                    {
                        goto _xg1_acpt_desc_2;
                    }
                    _xg1_acpt_desc_4:
                    retval = await xg1_acpt_desc_4();
                    if (retval.ToLower().Equals("xg1_acpt_desc_3"))
                    {
                        goto _xg1_acpt_desc_3;
                    }
                    retval = await xg1_acpt_desc_5();
                    if (retval.ToLower().Equals("xg1_acpt_desc_4"))
                    {
                        goto _xg1_acpt_desc_4;
                    }
                    await xg1_99_exit();

                    //   perform ze0-accept-reference-field  thru ze0-99-exit.;
                    await ze0_accept_reference_field();
                    await ze0_99_exit();
                }
            }

            update_confirmation = "";

            //     perform zb0-accept-confirm-update thru zb0-99-exit.;
            await zb0_accept_confirm_update();
            await zb0_99_exit();

            // if update-confirmed then        
            if (update_confirmation.Equals(update_confirmed))
            {
                // 	   go to xg0-50-update-header;                
                return "xg0_50_update_header";
            }
            // else  if update-modify then            
            else if (update_confirmation.Equals(update_modify))
            {
                // 	   go to xg0-update-claim-00;
                await xg0_update_claim_00();
                return string.Empty;
            }
            else
            {
                warn_ind = 3;
                //  perform zd0-common-warning      thru zd0-99-exit;
                await zd0_common_warning();
                await zd0_99_exit();
                // 	   go to xg0-99-exit.;                
                return "xg0_99_exit";
            }
            return string.Empty;
        }

        private async Task xg0_50_update_header()
        {
            await Exit_Trakker();
            //Util.Trakker(++ctr, "xg0_50_update_header");

            //     perform xe0-rewrite-clmhdr		thru xe0-99-exit.;
            await xe0_rewrite_clmhdr();
            await xe0_99_exit();

            //  if ws-pat-read-ind = "IK" then
            if (ws_pat_read_ind == "IK")
            {
                //      perform xe1-re-write-patient     	thru xe1-99-exit;
                await xe1_re_write_patient();
                await xe1_99_exit();
            }
            //  else if ws-pat-read-ind = "OD" then            
            else if (ws_pat_read_ind == "OD")
            {
                //           perform xe2-re-write-patient-od  	thru xe2-99-exit;
                await xe2_re_write_patient_od();
                await xe2_99_exit();
            }
            //  else if ws-pat-read-ind = "HC"  then            
            else if (ws_pat_read_ind == "HC")
            {
                //              perform xe3-re-write-patient-hc    thru xe3-99-exit;
                await xe3_re_write_patient_hc();
                await xe3_99_exit();
            }
            //  else  if ws-pat-read-ind = "AC"  then            
            else if (ws_pat_read_ind == "AC")
            {
                //                 perform xe4-re-write-patient-acr   thru xe4-99-exit;
                await xe4_re_write_patient_acr();
                await xe4_99_exit();
            }
            else
            {
                //        perform xe5-re-write-patient-chrt  thru xe5-99-exit.;
                await xe5_re_write_patient_chrt();
                await xe5_99_exit();
            }


            //  perform xg2-desc-dtl-update 	thru xg2-99-exit;
            //     	    varying ss-desc from 1 by 1;
            //      	until ss-desc > 5.;

            ss_desc = 1;
            do
            {
                if (F002_CLAIMS_MSTR_DTL_DESC_Collection.Count() > 0 && ss_desc <= F002_CLAIMS_MSTR_DTL_DESC_Collection.Count())
                {
                    objF002_CLAIMS_MSTR_DTL_DESC = F002_CLAIMS_MSTR_DTL_DESC_Collection[ss_desc - 1];
                }
                await xg2_desc_dtl_update();
                await xg2_99_exit();
                ss_desc++;
            } while (ss_desc <= 5);

        }

