            // if ws-subscr-dt-msg-no-eff-to-mm  = 0 then            
            if (ws_subscr_dt_msg_no_eff_to_mm == 0)
            {
                ws_subscr_dt_msg_no_eff_to_yy = 0;
            }

            //     accept scr-subscr-date-eff-to-dd.;
            Display3("scr-acpt-direct-bill-agent.", "scr-subscr-date-eff-to-dd");
            await Prompt("ws_subscr_dt_msg_no_eff_to_dd");


            // if  ws-subscr-dt-msg-no-eff-to-r1 is numeric and ws-subscr-dt-msg-no-eff-to-r1 not = zeros  then     
            if (Util.IsNumeric(ws_subscr_dt_msg_no_eff_to_r1) && Util.NumInt(ws_subscr_dt_msg_no_eff_to_r1) > 0)
            {
                // 	     if ws-subscr-dt-msg-no-eff-to-mm  > 00 and < 13  and ws-subscr-dt-msg-no-eff-to-dd     > 00  and < 32  then        
                if (ws_subscr_dt_msg_no_eff_to_mm > 0 && ws_subscr_dt_msg_no_eff_to_mm < 13 && ws_subscr_dt_msg_no_eff_to_dd > 0 && ws_subscr_dt_msg_no_eff_to_dd < 32)
                {
