                    // 	           else if    (  ws-subscr-dt-msg-no-eff-to-mm  = 4   or = 6 or = 9  or = 11 ) and ws-subscr-dt-msg-no-eff-to-dd > 30  then            
                    else if ((ws_subscr_dt_msg_no_eff_to_mm == 4 || ws_subscr_dt_msg_no_eff_to_mm == 6 || ws_subscr_dt_msg_no_eff_to_mm == 9 || ws_subscr_dt_msg_no_eff_to_mm == 11) && ws_subscr_dt_msg_no_eff_to_dd > 30)
                    {
                        err_ind = 28;
                        //     perform za0-common-error	thru za0-99-exit;
                        await za0_common_error();
                        await za0_99_exit();
                        // 	  go to xg1-acpt-sub-eff-date;
                        await xg1_acpt_sub_eff_date();
                        return;
                    }
                    else
                    {
                        // 		            next sentence;
                    }
                }
                else
                {
                    err_ind = 27;
                    //  perform za0-common-error	thru za0-99-exit;
                    await za0_common_error();
                    await za0_99_exit();
                    // 	          go to xg1-acpt-sub-eff-date;
                    await xg1_acpt_sub_eff_date();
                    return;
                }
            }
            // else if  (   ws-subscr-dt-msg-no-eff-to-r1 = spaces  or ws-subscr-dt-msg-no-eff-to-r1 = zeros    )  and ws-subscr-msg-nbr = "00"  then
            else if ((string.IsNullOrWhiteSpace(ws_subscr_dt_msg_no_eff_to_r1) || Util.NumInt(ws_subscr_dt_msg_no_eff_to_r1) == 0) && Util.NumInt(ws_subscr_msg_nbr) == 0)
            {
