            if (Util.Str(hold_desc_before[ss_desc]).ToUpper() == "Y" && Util.Str(hold_desc_after[ss_desc]).ToUpper() == "Y" && string.IsNullOrWhiteSpace(hold_desc_change[ss_desc]))
