            }
            // else if hold-desc-before(ss-desc) = "Y" and  hold-desc-after(ss-desc)  = "Y" and  hold-desc-change(ss-desc) = "Y" then            
            else if (Util.Str(hold_desc_before[ss_desc]).ToUpper() == "Y" && Util.Str(hold_desc_after[ss_desc]).ToUpper() == "Y" && Util.Str(hold_desc_change[ss_desc]).ToUpper() == "Y")
            {
                // 	    perform xr0-rewrite-clmdtl     	thru xr0-99-exit;
                await Rewrite_claims_dtl_desc_rec();
                //await xr0_rewrite_clmdtl();
                //await xr0_99_exit();
