            // else if hold-desc-before(ss-desc) = "Y" and hold-desc-after(ss-desc)  = space then            
            else if (Util.Str(hold_desc_before[ss_desc]).ToUpper() == "Y" && string.IsNullOrWhiteSpace(hold_desc_after[ss_desc]))
            {
                // 		perform xs0-delete-clmdtl     	    thru xs0-99-exit;
                await delete_claims_dtl_desc_rec();
                //await xs0_delete_clmdtl();
                //await xs0_99_exit();
