            // else if hold-desc-before(ss-desc) = space and  hold-desc-after(ss-desc)  = "Y" then            
            else if (string.IsNullOrWhiteSpace(hold_desc_before[ss_desc]) && Util.Str(hold_desc_after[ss_desc]).ToUpper() == "Y")
