        private async Task xg4_accept_verify_ref_date()
        {
            await Exit_Trakker();
            //Util.Trakker(++ctr, "xg4_accept_verify_ref_date");

            Display3("scr-dis-desc.", "scr-dis-desc-refer", false);
            Display3("scr-dis-desc.", "scr-reference", false);
            //     display scr-dis-ref.;
            Display3("scr-dis-ref.");

            clmhdr_ref_date_yy = Util.NumInt(Util.Str(clmhdr_reference).PadLeft(8, '0').Substring(0, 4));
            clmhdr_ref_date_mm = Util.NumInt(Util.Str(clmhdr_reference).PadLeft(8, '0').Substring(4, 2));
            clmhdr_ref_date_dd = Util.NumInt(Util.Str(clmhdr_reference).PadLeft(8, '0').Substring(6, 2));

            //     accept  scr-ref-date-yy.;
            await Prompt("clmhdr_ref_date_yy");

            // if clmhdr-ref-date-yy is numeric then            
            if (Util.IsNumeric(clmhdr_ref_date_yy.ToString()))
            {
                century_year = clmhdr_ref_date_yy;
                //   perform y2k-add-century-to-year     thru    y2k-99-exit;
                await y2k_add_century_to_year();
                await y2k_99_exit();
                clmhdr_ref_date_yy = century_year;
            }

            //     display scr-ref-date-mm.;
            //     accept  scr-ref-date-mm.;
            Display3("scr-dis-ref.", "scr-ref-date-mm");
            await Prompt("clmhdr_ref_date_mm");

            //  if clmhdr-ref-date-mm is numeric then            
            if (Util.IsNumeric(clmhdr_ref_date_mm.ToString()))
            {
                //         if clmhdr-ref-date-mm  = 0 then            
                if (clmhdr_ref_date_mm == 0)
                {
                    clmhdr_ref_date_yy = 0;
                }
            }

            //     display scr-ref-date-dd.;
            Display3("scr-dis-ref.", "scr-ref-date-dd");
            //     accept  scr-ref-date-dd.;
            await Prompt("clmhdr_ref_date_dd");

            //  if  clmhdr-ref-date-mm is numeric and clmhdr-ref-date-dd is numeric then    
            if (Util.IsNumeric(clmhdr_ref_date_mm.ToString()) && Util.IsNumeric(clmhdr_ref_date_dd.ToString()))
            {
                // 	    if  clmhdr-ref-date-mm > 00 and clmhdr-ref-date-mm < 13 and clmhdr-ref-date-dd > 00 and clmhdr-ref-date-dd < 32 then            
                if (clmhdr_ref_date_mm > 0 && clmhdr_ref_date_mm < 13 && clmhdr_ref_date_dd > 0 && clmhdr_ref_date_dd < 32)
                {
                    // 	        if clmhdr-ref-date-mm = 2 and clmhdr-ref-date-dd > 29 then            
                    if (clmhdr_ref_date_mm == 2 && clmhdr_ref_date_dd > 29)
                    {
                        err_ind = 28;
                        //        perform za0-common-error	thru za0-99-exit;
                        await za0_common_error();
                        await za0_99_exit();
                        // 		        go to xg4-accept-verify-ref-date;
                        await xg4_accept_verify_ref_date();
                        return;
                    }
                    // 	         else if  (clmhdr-ref-date-mm = 4  or  clmhdr-ref-date-mm = 6 or  clmhdr-ref-date-mm = 9  or  clmhdr-ref-date-mm = 11 ) and clmhdr-ref-date-dd > 30 then            
                    else if ((clmhdr_ref_date_mm == 4 || clmhdr_ref_date_mm == 6 || clmhdr_ref_date_mm == 9 || clmhdr_ref_date_mm == 11) && clmhdr_ref_date_dd > 30)
                    {
                        err_ind = 28;
                        // 	      perform za0-common-error	thru za0-99-exit;
                        await za0_common_error();
                        await za0_99_exit();
                        // 		          go to xg4-accept-verify-ref-date;
                        await xg4_accept_verify_ref_date();
                        return;
                    }
                    else
                    {
                        // 		        next sentence;
                    }
                }
                else
                {
                    err_ind = 27;
                    //       perform za0-common-error	thru za0-99-exit;
                    await za0_common_error();
                    await za0_99_exit();

                    // 	   go to xg4-accept-verify-ref-date;
                    await xg4_accept_verify_ref_date();
                    return;
                }
            }
            else
            {
                err_ind = 27;
                // perform za0-common-error	thru za0-99-exit;
                await za0_common_error();
                await za0_99_exit();
                // 	go to xg4-accept-verify-ref-date.;
                await xg4_accept_verify_ref_date();
                return;
            }
        }

