        private async Task xh0_move_clmdtl_to_hold_area()
        {
            await Exit_Trakker();
            //Util.Trakker(++ctr, "xh0_move_clmdtl_to_hold_area");

            // if clmdtl-oma-cd = "ZZZZ" then;            
            if (clmdtl_oma_cd == "ZZZZ")
            {
                // 	   add 1				to ss-desc;
                ss_desc++;
                hold_desc_rec[ss_desc] = await assign_claim_detail_rec_to_groupName(); // claim_detail_rec;     

                orig_desc[ss_desc] = clmdtl_desc;
                hold_desc_before[ss_desc] = "Y";
                hold_desc_feedback_claims[ss_desc] = feedback_claims_mstr;
                hold_desc_claims_occur[ss_desc] = claims_occur;
            }
            else
            {
                // 	   add 1				to ss-clmdtl;
                ss_clmdtl++;
                // 	   if clmdtl-adj-nbr not = zero then            
                if (Util.NumInt(clmdtl_adj_nbr) > 0)
                {
                    hold_clmadj_adj_cd[ss_clmdtl] = clmdtl_adj_cd;
                    hold_clmadj_per_end_date[ss_clmdtl] = Util.NumInt(clmdtl_date_period_end);
                    clmdtl_sv_date_grp = Util.Str(clmdtl_sv_yy).PadLeft(4,'0') + Util.Str(clmdtl_sv_mm).PadLeft(2,'0') + Util.Str(clmdtl_sv_dd).PadLeft(2,'0');
                    hold_clmadj_svc_date[ss_clmdtl] = Util.NumInt(clmdtl_sv_date_grp);
                    hold_clmadj_cyc[ss_clmdtl] = clmdtl_cycle_nbr;
                    hold_clmadj_batch_id_1_2[ss_clmdtl] = clmdtl_orig_batch_nbr_1_2;
                    hold_clmadj_batch_id_4_9[ss_clmdtl] = clmdtl_orig_batch_nbr_4_9;
                    hold_clmadj_orig_claim_nbr[ss_clmdtl] = clmdtl_orig_claim_nbr_in_batch;

                    hold_clmadj_tech_billed[ss_clmdtl] = clmdtl_amt_tech_billed;
                    ws_agent_flag = clmhdr_agent_cd;
                    hold_clmadj_due[ss_clmdtl] = clmdtl_fee_ohip;
                    // 	       subtract   clmdtl-amt-tech-billed;
                    // 		           from   clmdtl-fee-ohip;
                    // 		           giving hold-clmadj-prof-billed (ss-clmdtl);
                    hold_clmadj_prof_billed[ss_clmdtl] = clmdtl_fee_ohip - clmdtl_amt_tech_billed;

                }
                else
                {
                    hold_oma_cd[ss_clmdtl] = clmdtl_oma_cd;
                    hold_oma_suff[ss_clmdtl] = clmdtl_oma_suff;
                    hold_clm_per_end_date[ss_clmdtl] = Util.NumInt(clmdtl_date_period_end);
