                    hold_clm_tech_billed[ss_clmdtl] = clmdtl_amt_tech_billed;
                    hold_feedback_clmdtl[ss_clmdtl] = feedback_claims_mstr;
                    hold_occurs_clmdtl[ss_clmdtl] = claims_occur;

                    hold_claim_detail_rec[ss_clmdtl] = await assign_claim_detail_rec_to_groupName();  //claim_detail_rec_grp;


                    // 	       perform xh1-move-svc-dates	thru xh1-99-exit;
                    // 			    varying		ss;
                    // 			    from		1;
                    // 			    by		1;
                    // 			    until		ss > 3;

                    ss = 1;
                    do
                    {
                        await xh1_move_svc_dates();
                        await xh1_99_exit();
                        ss++;
                    } while (ss <= 3);


                    ws_agent_flag = clmhdr_agent_cd;
                    hold_clm_amt_due[ss_clmdtl] = clmdtl_fee_ohip;

                    // 	       subtract   clmdtl-amt-tech-billed;
