        // process_rejected_claims_change.rtn
        private async Task<string> yy3a_update_matching_pat_recs()
        {
            await Exit_Trakker();
            //Util.Trakker(++ctr, "yy3a_update_matching_pat_recs");

            //  if clmhdr-pat-ohip-id-or-chart of claim-header-rec = clmhdr-pat-id of rejected-claims-rec then            

            clmhdr_pat_ohip_id_or_chart_grp = Util.Str(clmhdr_pat_key_type) + Util.Str(objClaims_mstr_rec.CLMHDR_PAT_KEY_DATA);
            if (clmhdr_pat_ohip_id_or_chart_grp == Util.Str(objRejected_claims_rec.CLMHDR_PAT_OHIP_ID_OR_CHART))
            {
                objRejected_claims_rec.LOGICALLY_DELETED_FLAG = "Y";
                //         rewrite rejected-claims-rec;
                //             invalid key;
                //                 go to yy3a-99-exit.;

                try
                {
                    objRejected_claims_rec.RecordState = State.Modified;
                    objRejected_claims_rec.Submit();
                }
                catch (Exception e)
                {
                    //   go to yy3a-99-exit.;
                    return "yy3a_99_exit";
                }
            }

            //      add 1				to ctr-updated-rejected-claims.;
            ctr_updated_rejected_claims++;

            //  read rejected-claims next  into rejected-claims-rec;
            //         at end;
            //             go to yy3a-99-exit.;

            if (ctr_read_rejected_claims >= Rejected_claims_rec_Collection.Count())
            {
                //             go to yy3a-99-exit.;                
                return "yy3a_99_exit";
            }

            objRejected_claims_rec = Rejected_claims_rec_Collection[ctr_read_rejected_claims];

            //      add 1                              to ctr-read-rejected-claims.;
            ctr_read_rejected_claims++;

            //  if clmhdr-pat-ohip-id-or-chart of claim-header-rec not = clmhdr-pat-id of rejected-claims-rec then 

            clmhdr_pat_ohip_id_or_chart_grp = Util.Str(objClaims_mstr_rec.CLMHDR_PAT_KEY_TYPE) + Util.Str(objClaims_mstr_rec.CLMHDR_PAT_KEY_DATA);
            if (clmhdr_pat_ohip_id_or_chart_grp != Util.Str(objRejected_claims_rec.CLMHDR_PAT_OHIP_ID_OR_CHART))
            {
                // 	    go to yy3a-99-exit;                
                return "yy3a_99_exit";
            }
            else
            {
                //          go to yy3a-update-matching-pat-recs.;
                await yy3a_update_matching_pat_recs();
            }

            return string.Empty;
        }

